- input: "TEXT\x1CC00468447\x1C.TEXT\x1C\x1CF3XN\x1CThis report contains a transaction
    that was intended as an Independent Expenditure in opposition to a candidate (and,
    therefore, ultimately in support of another).  However, we subsequently discovered
    that we used the same vendor to generate this mailing as the campaign of the ultimate
    beneficiary candidiate whose opponent our mailer was in opposition to.  Because
    we relied on the vendor to some extent in preparation, and do not have a firewall
    in place, we cannot rule out an inadvertant act of coordination having occured.
    \ Upon consultation with our FEC Analyst, we are reporting this transaction as
    memo text on line 21(b) and as a contribution on line 23 (to FRIENDS OF RAY).\n"
